[{'title': 'HalloBoer - lekker van dichtbij', 'date': {'start': {'month': 7, 'day': None, 'year': 2016}, 'end': {'month': None, 'day': None, 'year': None}}, 'description': 'Er is steeds meer behoefte aan lekker, gezond en duurzaam eten én aan slimme- en innovatieve oplossingen. Met HalloBoer laten we mensen bewuster hun omgeving en streekproducten ontdekken en waarderen.

Wat groeit en bloeit er in onze streek? En waar kan ik dat kopen?
Ons eetpatroon veranderd. Steeds meer consumenten zijn op zoek naar gemak en zijn zich tevens bewust van welke voeding goed is en waar het vandaan komt. Zij willen ontzorgd worden met lekkere en gemakkelijke producten die verantwoord en duurzaam zijn en duidelijkheid krijgen over wie de producent is en waar het product precies vandaan komt.

Samen op weg naar transparantie
Met HalloBoer bieden wij een samenwerkingsplatform en datingsite om jouw product, bedrijf, samenwerkingsverband en persoonlijkheid op de kaart te zetten. Direct contact leggen met de omgeving en mensen en bedrijven van dichtbij. HalloBoer brengt vraag en aanbod bij elkaar. Samen zetten we de mooiste Nederlandse producten in de etalage bij ketenpartners, de consument en partners uit de regio.

Nieuwe marktkansen voor ondernemers
Met collectieve marketing, verkoop en een logistiek systeem biedt HalloBoer de mogelijkheden om een nieuw marktpotentieel aan te boren. Rechtstreeks aan de consument of met bedrijven in de regio, die vrijheid heb jezelf.

Ook als je nog niet regionaal wilt ondernemen zetten we je wel graag op de kaart. Nu nog regionaal, maar straks landelijk en wie weet internationaal. Doe mee en zet jezelf op de kaart!', 'contributors': [{'type': 'standardizedContributor', 'first_name': 'Niels', 'last_name': 'Tomson', 'name': None, 'headline': 'Mede Initiator, kartrekker en energiebeheerder at HalloBoer'}]}, {'title': 'Milieukansen, prestaties en diversiteit van melkveehouderij bruikbaar voor het onderwijs', 'date': {'start': {'month': 9, 'day': None, 'year': 2011}, 'end': {'month': None, 'day': None, 'year': 2013}}, 'description': 'Dit WURKS-project sluit aan bij de goedgekeurde KIGO. KIGO gelden worden vooral ingezet voor aftrapbijeenkomsten, gastlessen en themabijeenkomsten. WURKS gelden om de kennis die daarbij nodig is te ontsluiten.  

